import React from "react";



export default class Login extends React.Component{


    render(){

        return(<div>
            <div className="container">
                <div className="row">
                    <div className="col-md-6 col-sm-12 align-self-center">Column 1</div>
                    <div className="col-md-6 col-sm-12 align-self-center">Column 2</div>
                </div>
            </div>

        </div>);
    }
}
